// SPDX-License-Identifier: SimPL-2.0

pragma solidity ^0.7.0;

import "../utlis/Helper.sol";
import "../token/Fighter.sol";
import "../core/CardShop.sol";
import "../authority/Member.sol";

import "@openzeppelin/contracts/math/SafeMath.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721.sol";

/**
 * @title Fighter Z Token Card Shop
 *
 * It's mainly used for pledge to get M3T Token
 * QUANTITIES: 2 MILLION | DECIMALS: 18
 *
 * @author Bit Lighthouse. Ace
 * AT: 2021-3-28 | VERSION: v1.0.2
 */

contract Exchange is Member {
    using SafeMath for uint256;

    mapping (uint8 => uint256[]) public _rates;
    mapping (uint8 => uint256[]) public _groups;
    mapping (uint64 => uint256) public _redeemeds;
    mapping (uint64 => address) public _owners;
    mapping (address => uint256) public _receives;

    event Redeemed(uint8 quality, uint256 amount);

    constructor(address auth_) Member(auth_) {

    }

    function redeemed(uint64 tokenId_) public {
        require(
            _redeemeds[tokenId_] <= 0,
            "EXCHANGE: The NFT has been redeemed."
        );

        Fighter figh = Fighter(authority.members("FIGHTER"));

        require(
            msg.sender == figh.ownerOf(tokenId_),
            "EXCHANGE: Only onwer."
        );

        uint8 quality; uint8 heroId; uint32 timestamp;
        (quality, heroId, timestamp) = Helper.analysis(tokenId_);

        uint256 random = Helper.random(_rates[quality][1]);
        random = random.add(_rates[quality][0]);

        uint256 amount = random;
        address token = authority.members("TOKEN");
        IERC20(token).transfer(address(this), amount);

        figh.doBurn(tokenId_);
        CardShop cd = CardShop(authority.members("CARDSHOP"));
        cd.freshExchange(quality, heroId);

        emit Redeemed(quality, amount);
    }

    function received(uint8 quality_) public {
        Fighter figh = Fighter(authority.members("FIGHTER"));
        uint256 length = figh.balanceOf(msg.sender);

        uint256 total = 0;
        uint64[] memory tokens = new uint64[](length);
        uint64[] memory heroIds = new uint64[](length);

        for (uint256 i = 0; i < length; i++) {
            uint8 quality = 50;
            uint256 tokenId = figh.tokenOfOwnerByIndex(
                msg.sender, i
            );

            (quality, heroIds[i],) = Helper.analysis(
                uint64(tokenId)
            );
            if (quality != quality_) continue;
            total = total + 1;
            tokens[i] = uint64(tokenId);
        }

        require(
            total >= _groups[quality_][0],
            "EXCHANGE: Insufficient number of NFTs."
        );

        uint256 times = total / _groups[quality_][0];
        require(
            times < _receives[msg.sender],
            "EXCHANGE: Reward received."
        );

        IERC20 token = IERC20(authority.members("TOKEN"));
        address account = authority.members("FOUND");
        uint256 balance = token.balanceOf(account);

        uint256 reward = balance.mul(_groups[quality_][1]);
        token.transferFrom(account, msg.sender, reward.div(100));

        _receives[msg.sender] = _receives[msg.sender] + 1;

        CardShop cd = CardShop(authority.members("CARDSHOP"));

        for (uint i = 0; i < length; i++) {
            if (tokens[i] <= 0) continue;

            figh.doBurn(tokens[i]);
            cd.freshExchange(quality_, heroIds[i]);
        }
    }

    function deposit(uint64 tokenId_) public {
        IERC721 figh = IERC721(authority.members("FIGHTER"));
        require(
            msg.sender == figh.ownerOf(tokenId_),
            "EXCHANGE: Only onwer."
        );

        figh.transferFrom(msg.sender, address(this), tokenId_);
        _owners[tokenId_] = msg.sender;
    }
}

